//SPDX-License-Identifier:MIT
pragma solidity ^0.8.13;

contract IfElse{
    function foo(uint x) public pure returns(uint){
        //if后面()里面加判断条件 {}内写条件满足是会执行语句
        if (x < 10) {
            return 0;
        } else if (x < 20){
            return 1;
        } else {
            return 2;
        }
    }

    function ternaly(uint _x) public pure returns (uint){
        return _x < 10 ? 1 : 2; //当小于10时候返回1 其他的时候返回2
    }
}

contracts/010ForWhile.sol.content:
//SPDX-License-Identifier:MIT
pragma solidity ^0.8.13;

contract ForWhile{
    function addtotal() public pure returns(uint){
        //定义一个数，初始为0
        uint numa;
        //
        for(uint i = 0; i < 50; i++){
            numa += i;
        }
        return numa;
    }

    function loop() public pure{
        for (uint256 i = 0; i < 10; i++) {
            if (i == 3) {
                // Skip to next iteration with continue
                continue;
            }
            if (i == 5) {
                // Exit loop with break
                break;
            }
        }

        uint j;
        while(j < 10){
            j++;
        }
    }
}

contracts/011Map.sol.content:
//SPDX-License-Identifier:MIT
pragma solidity ^0.8.13;

contract Mapping{
    //mapping的语法是mapping（keyvalue关键值 => valueType某个值类型） 一一匹配起来
    // keyvalue可以是string bool int address bytes 或者是某个已经部署的合约
    // valuetype可以是多种类型变量甚至是另一种mapping或者是一个array(动态数组)
    
    mapping(address => uint) public myMap; //定义了一个map方法，将一个地址和一个数字匹配起来

    function getbyAdd(address _add) public view returns(uint){
    //返回的是这个mapping方法对应的数，如果没有则返回默认值0
        return myMap[_add];
    }

    function set(address _add,uint _i) public {
    //更新每一个地址对应的数
        myMap[_add] = _i;
    }
    function deleteNum(address _add) public{
    //delete就是把每个地址匹配的值恢复为初始值
        delete myMap[_add];
    }
}

contracts/012NextMap.sol.content:
//SPDX-License-Identifier:MIT
pragma solidity ^0.8.13;

contract NextMapping{
    mapping(address => mapping(uint => bool)) public nested; //（将地址和另一个Mapping方法匹配到一起）

    function get(address _add,uint _num) public view returns(bool){
        //nested[_add]返回的是一个mapping方法 然后这个方法[_num]返回的是一个bool
        return nested[_add][_num];
    }
    function set(address _add,uint _num,bool _boo) public{
        //set方法
        nested[_add][_num] = _boo;  
    }

    function deleteNum(address _add,uint _num) public{
        delete nested[_add][_num];
    }
}

